import React from 'react';

class Avatar extends React.Component {
  render() {
    return (
      <div>
        <img
          className='Hall9000'
          src='data:image/jpeg;base64,'
          alt='Hal9000'
        />
      </div>
    );
  }
}

export default Avatar;
